import "./App.css";
import Header from "./Header";
import Overview from "./Overview";

function App() {
  const [selectedRegion, setSelectedRegion] = useState("worldwide");

  const changeSelectedRegion = (region) => {
    setSelectedRegion(region);
  };

  return (
    <div className="App">
      <header className="App-header">
        <Header onSelectedRegionChange={changeSelectedRegion} />
      </header>
      <Overview />
    </div>
  );
}

export default App;
